 \"main/components/Sections/SectionsTable\";\nimport { handleAddToSchedule } from \"main/components/Sections/SectionsTable\";\nimport { handleLectureAddToSchedule } from \"main/components/Sections/SectionsTable\";\nimport {\n  isLectureWithNoSections,\n  isLectureWithSections,\n} from \"main/components/Sections/SectionsTable\";\nimport { useBackendMutation } from \"main/utils/useBackend\";\n\nconst mockedNavigate = jest.fn();\n\nconst colId = \"12591\";\nconst colId1 = \"30395\";\nconst colId2 = \"54692\";\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\njest.mock(\"react-toastify\", () => ({\n  toast: jest.fn(),\n}));\n\njest.mock(\"main/utils/useBackend\", () => ({\n  useBackendMutation: jest.fn(),\n}));\n\ndescribe(\"isLectureWithNoSections\", () => {\n  it(\"should return true when the section is a lecture with no other sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(true);\n  });\n\n  it(\"should return false when the section is not a lecture\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0101\" },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n\n  it(\"should return false when the section is a lecture but there are other sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67890\", section: \"0101\" },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n\n  it(\"should return false when the section is not found\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1 -1\" },\n        section: { enrollCode: \"67890\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1 -2\" },\n        section: { enrollCode: \"67891\", section: \"0200\" },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return true when the section number ends in 00 and is not 0100 and has a location\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1 -1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"22200\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1 -2\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"22201\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(true);\n  });\n  it(\"should return false when the section number ends in 00 and is not 0100 and does not have a location\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"0200\",\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return false when the section number does not end in 00\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"0201\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return false when the section number ends in 00 and is not 0100 and has a section\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"0200\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12346\",\n          section: \"0201\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return false when the section number ends in 00 and is not 0100 and has time locations not equal to one\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"0200\",\n          timeLocations: [],\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n});\n\ndescribe(\"isLectureWithSections\", () => {\n  it(\"should return false when the section is a lecture with no other sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n\n  it(\"should return false when the section is not a lecture\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0101\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n\n  it(\"should return true when the section is a lecture but there are other sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67890\", section: \"0101\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n\n    expect(result).toBe(true);\n  });\n\n  it(\"should return false when the section is not found\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67890\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67891\", section: \"0100\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return false when section number does not end with '00'\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0101\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12346\", section: \"0102\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n    expect(result).toBe(false);\n  });\n  it(\"should return true when section number ends with '00' and there are multiple sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67890\", section: \"0100\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n    expect(result).toBe(true);\n  });\n});\n\ndescribe(\"handleAddToSchedule\", () => {\n  it(\"calls mutate with correct data\", () => {\n    const mockMutation = { mutate: jest.fn() };\n    const mockSection = { section: { enrollCode: \"123\" } };\n    const mockSchedule = \"456\";\n\n    handleAddToSchedule(mockSection, mockSchedule, mockMutation);\n\n    expect(mockMutation.mutate).toHaveBeenCalledWith({\n      enrollCd: \"123\",\n      psId: \"456\",\n    });\n  });\n});\n\ndescribe(\"handleLectureAddToSchedule\", () => {\n  it(\"should execute the mutation with the provided data\", () => {\n    // Mock the mutation object\n    const mutationMock = {\n      mutate: jest.fn(),\n    };\n\n    // Define the input data\n    const section = 12345;\n    const schedule = \"FALL2023\";\n\n    // Call the function\n    handleLectureAddToSchedule(section, schedule, mutationMock);\n\n    // Assert that the mutation.mutate function was called with the expected data\n    expect(mutationMock.mutate).toHaveBeenCalledWith({\n      enrollCd: section,\n      psId: schedule,\n    });\n  });\n});\n\ndescribe(\"objectToAxiosParams\", () => {\n  it(\"should return the correct axios parameters\", () => {\n    const data = {\n      enrollCd: 12345,\n      psId: 15,\n    };\n\n    const result = objectToAxiosParams(data);\n\n    expect(result).toEqual({\n      url: \"/api/courses/post\",\n      method: \"POST\",\n      params: {\n        enrollCd: \"12345\",\n        psId: \"15\",\n      },\n    });\n  });\n});\n\ndescribe(\"Section tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"calls onSuccess when mutation is successful and calls toast with correct parameters\", () => {\n    const mockMutate = jest.fn();\n    const mockMutation = { mutate: mockMutate };\n\n    useBackendMutation.mockReturnValue(mockMutation);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Call the onSuccess function\n    const onSuccess = useBackendMutation.mock.calls[0][1].onSuccess;\n    const mockResponse = [{ id: 1, enrollCd: \"1234\" }];\n    onSuccess(mockResponse);\n\n    // Verify that toast was called with the correct parameters\n    expect(toast).toHaveBeenCalledWith(\n /CourseOverTimeSearchForm\";\n\njest.mock(\"react-toastify\", () => ({\n  toast: jest.fn(),\n}));\n\ndescribe(\"CourseOverTimeSearchForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  const queryClient = new QueryClient();\n  const addToast = jest.fn();\n\n  const mockSections = [\n    {\n      courseInfo: {\n        quarter: \"20231\",\n        courseId: \"CMPSC156\",\n        title: \"Advanced Applications Programming\",\n      },\n      section: {\n        section: \"0100\",\n        enrolledTotal: 30,\n        maxEnroll: 50,\n        timeLocations: [],\n        instructors: [],\n        enrollCode: \"12345\",\n      },\n    },\n  ];\n\n  beforeEach(() => {\n    jest.clearAllMocks();\n    jest.spyOn(console, \"error\").mockImplementation(() => null);\n\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      ...systemInfoFixtures.showingNeither,\n      startQtrYYYYQ: \"20201\",\n      endQtrYYYYQ: \"20214\",\n    });\n\n    toast.mockReturnValue({\n      addToast: addToast,\n    });\n  });\n\n  afterEach(() => {\n    cleanup();\n  });\n\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"when I select an end quarter, the state for end quarter changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20204\");\n    expect(selectEndQuarter.value).toBe(\"20204\");\n  });\n\n  test(\"when I select a subject, the state for subject changes\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedKey = await screen.findByTestId(\n      \"CourseOverTimeSearch.Subject-option-MATH\",\n    );\n    expect(expectedKey).toBeInTheDocument();\n\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    userEvent.selectOptions(selectSubject, \"MATH\");\n\n    expect(selectSubject.value).toBe(\"MATH\");\n  });\n\n  test(\"when I select a course number without suffix, the state for course number changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"24\");\n    expect(selectCourseNumber.value).toBe(\"24\");\n  });\n\n  test(\"when I select a course number with suffix, the state for course number changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"130A\");\n    expect(selectCourseNumber.value).toBe(\"130A\");\n  });\n\n  test(\"when I select a course number without number, the state for course number changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"A\");\n    expect(selectCourseNumber.value).toBe(\"A\");\n  });\n\n  test(\"when I click submit, the right stuff happens\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    const sampleReturnValue = {\n      sampleKey: \"sampleValue\",\n    };\n\n    const fetchJSONSpy = jest.fn().mockResolvedValue(sampleReturnValue);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedFields = {\n      startQuarter: \"20211\",\n      endQuarter: \"20214\",\n      subject: \"CMPSC\",\n      courseNumber: \"130\",\n      courseSuf: \"A\",\n    };\n\n    const expectedKey = await screen.findByTestId(\n      \"CourseOverTimeSearch.Subject-option-CMPSC\",\n    );\n    expect(expectedKey).toBeInTheDocument();\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20211\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20214\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    expect(selectSubject).toBeInTheDocument();\n    userEvent.selectOptions(selectSubject, \"CMPSC\");\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"130A\");\n    const submitButton = screen.getByText(\"Submit\");\n    userEvent.click(submitButton);\n\n    await waitFor(() => expect(fetchJSONSpy).toHaveBeenCalledTimes(1));\n\n    expect(fetchJSONSpy).toHaveBeenCalledWith(\n      expect.any(Object),\n      expectedFields,\n    );\n  });\n\n  test(\"when I click submit when JSON is EMPTY, setCourse is not called!\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n\n    const sampleReturnValue = {\n      sampleKey: \"sampleValue\",\n      total: 0,\n    };\n\n    const fetchJSONSpy = jest.fn().mockResolvedValue(sampleReturnValue);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedKey = await screen.findByTestId(\n      \"CourseOverTimeSearch.Subject-option-CMPSC\",\n    );\n    expect(expectedKey).toBeInTheDocument();\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20204\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20204\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    userEvent.selectOptions(selectSubject, \"CMPSC\");\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"130A\");\n    const submitButton = screen.getByText(\"Submit\");\n    userEvent.click(submitButton);\n  });\n\n  test(\"renders without crashing when fallback values are used\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(/CourseOverTimeSearch.StartQuarter-option-0/),\n    ).toHaveValue(\"20211\");\n    expect(\n      await screen.findByTestId(/CourseOverTimeSearch.StartQuarter-option-3/),\n    ).toHaveValue(\"20214\");\n  });\n\n  test(\"when I select a course number with the course area too, the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"CMPSC156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n\n  test(\"when I select a course number with the course area too (lowercase), the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"cmpsc 156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n  test(\"when I select a course number with the course area too (except cs), the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"cs156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n  test(\"when I select a course number with the course area too (random casing), the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"cMpSc156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n  test(\"when I select a course number with lowercase suffix, it still gives the correct output\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"cmPsC         130a\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n  test(\"when I select a course number with the just number, the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n});\n"},"src/tests/components/PersonalSchedules/PersonalScheduleForm.test.js":{"tests":[{"id":"42","name":"PersonalScheduleForm tests renders correctly","location":{"start":{"column":4,"line":32}}},{"id":"43","name":"PersonalScheduleForm tests renders correctly when passing in a PersonalSchedule","location":{"start":{"column":4,"line":48}}},{"id":"44","name":"PersonalScheduleForm tests Correct Error messages on missing input","location":{"start":{"column":4,"line":68}}},{"id":"45","name":"PersonalScheduleForm tests No Error messages on good input","location":{"start":{"column":4,"line":87}}},{"id":"46","name":"PersonalScheduleForm tests that navigate(-1) is called when Cancel is clicked","location":{"start":{"column":4,"line":121}}},{"id":"47","name":"PersonalScheduleForm tests Fallback hardcoded values for startQtr and endQtr work when systemInfo doesn't provide any","location":{"start":{"column":4,"line":139}}},{"id":"48","name":"PersonalScheduleForm tests Shows error message when name exceeds maximum length","location":{"start":{"column":4,"line":180}}},{"id":"49","name":"PersonalScheduleForm tests Form has initialPersonalSchedule content with Fall quarter","location":{"start":{"column":4,"line":200}}},{"id":"50","name":"PersonalScheduleForm tests Form has initialPersonalSchedule content with Spring quarter","location":{"start":{"column":4,"line":236}}},{"id":"51","name":"PersonalScheduleForm tests Form has initialPersonalSchedule content with Summer quarter","location":{"start":{"column":4,"line":272}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\n\nimport PersonalScheduleForm from \"main/components/PersonalSchedules/PersonalScheduleForm\";\nimport { personalSchedulesFixtures } from \"fixtures/personalSchedulesFixtures\";\n\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"PersonalScheduleForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  beforeEach(() => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: \"20154\",\n      endQtrYYYYQ: \"20244\",\n    });\n  });\n\n  const queryClient = new QueryClient();\n\n  test(\"renders correctly\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalScheduleForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(/Name/)).toBeInTheDocument();\n    expect(screen.getByText(/Description/)).toBeInTheDocument();\n    expect(screen.getByText(/Quarter/)).toBeInTheDocument();\n    expect(screen.getByText(/Create/)).toBeInTheDocument();\n    expect(screen.getByText(\"S22\")).toBeInTheDocument();\n  });\n\n  test(\"renders correctly when passing in a PersonalSchedule\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalScheduleForm\n            initialPersonalSchedule={\n              personalSchedulesFixtures.onePersonalSchedule\n            }\n          />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(/PersonalScheduleForm-id/),\n    ).toBeInTheDocument();\n    expect(screen.getByText(/Id/)).toBeInTheDocument();\n    expect(screen.getByTestId(/PersonalScheduleForm-id/)).toHaveValue(\"1\");\n  });\n\n  test(\"Correct Error messages on missing input\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalScheduleForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n    expect(\n      await screen.findByTestId(\"PersonalScheduleForm-submit\"),\n    ).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"PersonalScheduleForm-submit\");\n\n    fireEvent.click(submitButton);\n\n    expect(await screen.findByText(/Name is required./)).toBeInTheDocument();\n    expect(screen.getByText(/Description is required./)).toBeInTheDocument();\n  });\n\n  test(\"No Error messages on good input\", async () => {\n    const mockSubmitAction = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalScheduleForm submitAction={mockSubmitAction} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"PersonalScheduleForm-name\"),\n    ).toBeInTheDocument();\n\n    const name = screen.getByTestId(\"PersonalScheduleForm-name\");\n    const description = screen.getByTestId(\"PersonalScheduleForm-description\");\n    const quarter = document.querySelector(\"#PersonalScheduleForm-quarter\");\n    const submitButton = screen.getByTestId(\"PersonalScheduleForm-submit\");\n\n    fireEvent.change(name, { target: { value: \"test\" } });\n    fireEvent.change(description, { target: { value: \"test\" } });\n    fireEvent.change(quarter, { target: { value: \"20124\" } });\n    fireEvent.click(submitButton);\n\n    await waitFor(() => expect(mockSubmitAction).toHaveBeenCalled());\n\n    expect(screen.queryByText(/Name is required./)).not.toBeInTheDocument();\n    expect(\n      screen.queryByText(/Description is required./),\n    ).not.toBeInTheDocument();\n    expect(quarter).toHaveValue(\"20154\");\n  });\n\n  test(\"that navigate(-1) is called when Cancel is clicked\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalScheduleForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n    expect(\n      await screen.findByTestId(\"PersonalScheduleForm-cancel\"),\n    ).toBeInTheDocument();\n    const cancelButton = screen.getByTestId(\"PersonalScheduleForm-cancel\");\n\n    fireEvent.click(cancelButton);\n\n    await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith(-1));\n  });\n\n  test(\"Fallback hardcoded values for startQtr and endQtr work when systemInfo doesn't provide any\", async () => {\n    const mockSubmitAction = jest.fn();\n\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalScheduleForm submitAction={mockSubmitAction} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"PersonalScheduleForm-name\"),\n    ).toBeInTheDocument();\n\n    const name = screen.getByTestId(\"PersonalScheduleForm-name\");\n    const description = screen.getByTestId(\"PersonalScheduleForm-description\");\n    const quarter = document.querySelector(\"#PersonalScheduleForm-quarter\");\n    const submitButton = screen.getByTestId(\"PersonalScheduleForm-submit\");\n\n    fireEvent.change(name, { target: { value: \"test\" } });\n    fireEvent.change(description, { target: { value: \"test\" } });\n    fireEvent.change(quarter, { target: { value: \"20124\" } });\n    fireEvent.click(submitButton);\n\n    await waitFor(() => expect(mockSubmitAction).toHaveBeenCalled());\n\n    expect(screen.queryByText(/Name is required./)).not.toBeInTheDocument();\n    expect(\n      screen.queryByText(/Description is required./),\n    ).not.toBeInTheDocument();\n    expect(quarter).toHaveValue(\"20211\");\n  });\n\n  test(\"Shows error message when name exceeds maximum length\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalScheduleForm />\n        <"+"/Router>\n  <"+"/QueryClientProvider>,\n    );\n  });\n  test(\"renders without crashing for empty table for ordinary user\", () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"UCSBSubjectsTable subjects={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for empty table for admin\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"UCSBSubjectsTable subjects={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected colum headers and content for adminUser\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"UCSBSubjectsTable\n            subjects={ucsbSubjectsFixtures.threeSubjects}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\n      \"SubjectCode\",\n      \"SubjectTranslation\",\n      \"DeptCode\",\n      \"CollegeCode\",\n      \"RelatedDeptCode\",\n      \"Inactive\",\n    ];\n    const expectedFields = [\n      \"subjectCode\",\n      \"subjectTranslation\",\n      \"deptCode\",\n      \"collegeCode\",\n      \"relatedDeptCode\",\n      \"inactive\",\n    ];\n    const testId = \"UCSBSubjectsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n ider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport PersonalSectionsTable from \"main/components/PersonalSections/PersonalSectionsTable\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { personalSectionsFixtures } from \"fixtures/personalSectionsFixtures\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\nconst mockedMutate = jest.fn();\n\njest.mock(\"main/utils/useBackend\", () => ({\n  ...jest.requireActual(\"main/utils/useBackend\"),\n  useBackendMutation: () => ({ mutate: mockedMutate }),\n}));\n\ndescribe(\"UserTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders without crashing for empty table with user not logged in\", () => {\n    const currentUser = null;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={[]}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for empty table for ordinary user\", () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={[]}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for empty table for admin\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={[]}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected column headers and content\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const psId = 1;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={personalSectionsFixtures.threePersonalSections}\n            psId={psId}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\n      \"Course ID\",\n      \"Enroll Code\",\n      \"Section\",\n      \"Title\",\n      \"Enrolled\",\n      \"Location\",\n      \"Days\",\n      \"Time\",\n      \"Instructor\",\n    ];\n    const expectedFields = [\n      \"courseId\",\n      \"classSections[0].enrollCode\",\n      \"classSections[0].section\",\n      \"title\",\n      \"enrolled\",\n      \"location\",\n      \"classSections[0].timeLocations[0].days\",\n      \"time\",\n      \"instructor\",\n    ];\n    const testId = \"PersonalSectionsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-courseId`),\n    ).toHaveTextContent(\"ECE 1A\");\n    expect(\n      screen.getByTestId(\n        `${testId}-cell-row-0-col-classSections[0].enrollCode`,\n      ),\n    ).toHaveTextContent(\"12583\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-classSections[0].section`),\n    ).toHaveTextContent(\"0100\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-title`),\n    ).toHaveTextContent(\"COMP ENGR SEMINAR\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-enrolled`),\n    ).toHaveTextContent(\"84/100\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-location`),\n    ).toHaveTextContent(\"BUCHN 1930\");\n    expect(\n      screen.getByTestId(\n        `${testId}-cell-row-0-col-classSections[0].timeLocations[0].days`,\n      ),\n    ).toHaveTextContent(\"M\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-time`),\n    ).toHaveTextContent(\"3:00 PM - 3:50 PM\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-instructor`),\n    ).toHaveTextContent(\"WANG L C\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-instructor`),\n    ).toHaveTextContent(\"STEPHANSON B, BUCKWALTER J\");\n\n    const deleteButton = screen.getByTestId(\n      `PersonalSectionsTable-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n\n  test(\"Delete button calls delete callback for ordinary user\", async () => {\n    const testId = \"PersonalSectionsTable\";\n    const currentUser = currentUserFixtures.userOnly;\n    const psId = 1;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={personalSectionsFixtures.threePersonalSections}\n            psId={psId}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-courseId`),\n    ).toHaveTextContent(\"ECE 1A\");\n\n    const deleteButton = screen.getByTestId(\n      `PersonalSectionsTable-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => expect(mockedMutate).toHaveBeenCalledTimes(1));\n  });\n});\n"},"src/tests/components/Nav/AppNavbar.test.js":{ working normally renders without crashing for user","location":{"start":{"column":6,"line":236}}},{"id":"79","name":"PersonalSchedulesEditPage tests tests where backend is working normally renders without crashing for admin","location":{"start":{"column":6,"line":248}}}],"source":"import { fireEvent, waitFor, render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport PersonalSchedulesEditPage from \"main/pages/PersonalSchedules/PersonalSchedulesEditPage\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"jest-mock-console\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => {\n  const originalModule = jest.requireActual(\"react-router-dom\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    useParams: () => ({\n      id: 17,\n    }),\n    Navigate: (x) => {\n      mockNavigate(x);\n      return null;\n    },\n  };\n});\n\ndescribe(\"PersonalSchedulesEditPage tests\", () => {\n  describe(\"when the backend doesn't return data\", () => {\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n      axiosMock.reset();\n      axiosMock.resetHistory();\n      axiosMock\n        .onGet(\"/api/currentUser\")\n        .reply(200, apiCurrentUserFixtures.userOnly);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n      axiosMock\n        .onGet(\"/api/personalschedules\", { params: { id: 17 } })\n        .timeout();\n    });\n\n    const queryClient = new QueryClient();\n    test(\"renders header but table is not present\", async () => {\n      const restoreConsole = mockConsole();\n\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"PersonalSchedulesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n      await screen.findByText(\"Edit Personal Schedule\");\n      expect(\n        screen.queryByTestId(\"PersonalSchedule-name\"),\n      ).not.toBeInTheDocument();\n      restoreConsole();\n    });\n  });\n\n  describe(\"tests where backend is working normally\", () => {\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n      axiosMock.reset();\n      axiosMock.resetHistory();\n      axiosMock\n        .onGet(\"/api/currentUser\")\n        .reply(200, apiCurrentUserFixtures.userOnly);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n      axiosMock\n        .onGet(\"/api/personalschedules\", { params: { id: 17 } })\n        .reply(200, {\n          id: 17,\n          user: {\n            id: 1,\n            email: \"phtcon@ucsb.edu\",\n            googleSub: \"115856948234298493496\",\n            pictureUrl:\n              \"https://lh3.googleusercontent.com/-bQynVrzVIrU/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmkGuVsELD1ZeV5iDUAUfe6_K-p8w/s96-c/photo.jpg\",\n            fullName: \"Phill Conrad\",\n            givenName: \"Phill\",\n            familyName: \"Conrad\",\n            emailVerified: true,\n            locale: \"en\",\n            hostedDomain: \"ucsb.edu\",\n            admin: true,\n          },\n          description: \"My Winter Courses\",\n          quarter: \"20221\",\n          name: \"CS156\",\n        });\n      axiosMock.onPut(\"/api/personalschedules\").reply(200, {\n        id: 17,\n        user: {\n          id: 1,\n          email: \"phtcon@ucsb.edu\",\n          googleSub: \"115856948234298493496\",\n          pictureUrl:\n            \"https://lh3.googleusercontent.com/-bQynVrzVIrU/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmkGuVsELD1ZeV5iDUAUfe6_K-p8w/s96-c/photo.jpg\",\n          fullName: \"Phill Conrad\",\n          givenName: \"Phill\",\n          familyName: \"Conrad\",\n          emailVerified: true,\n          locale: \"en\",\n          hostedDomain: \"ucsb.edu\",\n          admin: true,\n        },\n        description: \"My Plan for Winter\",\n        quarter: \"20221\",\n        name: \"Winter Courses\",\n      });\n    });\n\n    const queryClient = new QueryClient();\n    test(\"renders without crashing\", () => {\n      axiosMock.onGet(\"/api/personalschedules\").reply(200, []);\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"PersonalSchedulesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n    });\n\n    test(\"renders 'Back' button\", () => {\n      const queryClient = new QueryClient();\n      axiosMock.onGet(`/api/personalschedules?id=17`).reply(200, []);\n      axiosMock.onGet(`api/personalSections/all?psId=17`).reply(200, []);\n\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"PersonalSchedulesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n\n      const backButton = screen.getByRole(\"button\", { name: /back/i });\n      expect(backButton).toBeInTheDocument();\n\n      // Optional: Test button functionality\n      userEvent.click(backButton);\n      // Add your assertions here to ensure that clicking the button triggers the expected action.\n    });\n\n    test(\"Is populated with the data provided\", async () => {\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"PersonalSchedulesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n\n      await screen.findByTestId(\"PersonalScheduleForm-id\");\n\n      const idField = screen.getByTestId(\"PersonalScheduleForm-id\");\n      const nameField = screen.getByTestId(\"PersonalScheduleForm-name\");\n      const descriptionField = screen.getByTestId(\n        \"PersonalScheduleForm-description\",\n      );\n      const quarterField = screen.getByTestId(\"PersonalScheduleForm-quarter\");\n      const submitButton = screen.getByTestId(\"PersonalScheduleForm-submit\");\n\n      expect(idField).toBeInTheDocument();\n      expect(idField).toHaveValue(\"17\");\n\n      expect(nameField).toBeInTheDocument();\n      expect(nameField).toHaveValue(\"CS156\");\n\n      expect(descriptionField).toBeInTheDocument();\n      expect(descriptionField).toHaveValue(\"My Winter Courses\");\n\n      expect(quarterField).toBeInTheDocument();\n\n      expect(quarterField).toHaveValue(\"W22\");\n      expect(submitButton).toHaveTextContent(\"Update\");\n\n      fireEvent.change(nameField, { target: { value: \"Winter Courses\" } });\n      fireEvent.change(descriptionField, {\n        target: { value: \"My Plan for Winter\" },\n      });\n      fireEvent.click(submitButton);\n\n      await waitFor(() => expect(mockToast).toBeCalled());\n      expect(mockToast).toBeCalledWith(\n        \"PersonalSchedule Updated - id: 17 name: Winter Courses\",\n      );\n\n      expect(mockNavigate).toBeCalledWith({ to: \"/personalschedules/list\" });\n\n      expect(axiosMock.history.put.length).toBe(1); // times called\n      expect(axiosMock.history.put[0].params).toEqual({ id: 17 });\n      expect(axiosMock.history.put[0].data).toBe(\n        JSON.stringify({\n          user: {\n            id: 1,\n            email: \"phtcon@ucsb.edu\",\n            googleSub: \"115856948234298493496\",\n            pictureUrl:\n              \"https://lh3.googleusercontent.com/-bQynVrzVIrU/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmkGuVsELD1ZeV5iDUAUfe6_K-p8w/s96-c/photo.jpg\",\n            fullName: \"Phill Conrad\",\n            givenName: \"Phill\",\n            familyName: \"Conrad\",\n            emailVerified: true,\n            locale: \"en\",\n            hostedDomain: \"ucsb.edu\",\n            admin: true,\n          },\n          name: \"Winter Courses\",\n          description: \"My Plan for Winter\",\n          quarter: \"20221\",\n        }),\n      ); // posted object\n    });\n\n    test(\"renders without crashing for user\", () => {\n      const queryClient = new QueryClient();\n      axiosMock.onGet(\"/api/courses/user/all\").reply(200, []);\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"PersonalSchedulesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n    });\n\n    test(\"renders without crashing for admin\", () => {\n      const queryClient = new QueryClient();\n      axiosMock.onGet(\"/api/courses/admin/all\").reply(200, []);\n      render(\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>\n            <"+"PersonalSchedulesEditPage />\n          <"+"/MemoryRouter>\n        <"+"/QueryClientProvider>,\n      );\n    });\n  });\n});\n"},"src/tests/pages/AdminJobsPage.test.js":{"tests":[{"id":"80","name":"AdminJobsPage tests renders without crashing","location":{"start":{"column":4,"line":31}}},{"id":"81","name":"AdminJobsPage tests user can submit a test job","location":{"start":{"column":4,"line":65}}},{"id":"82","name":"AdminJobsPage tests user can submit the update course data job","location":{"start":{"column":4,"line":102}}},{"id":"83","name":"AdminJobsPage tests user can submit the update course data by quarter job","location":{"start":{"column":4,"line":150}}},{"id":"84","name":"AdminJobsPage tests user can submit the update course data by quarter range job","location":{"start":{"column":4,"line":191}}},{"id":"85","name":"AdminJobsPage tests user can submit update grade info","location":{"start":{"column":4,"line":232}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nimport AdminJobsPage from \"main/pages/AdminJobsPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport jobsFixtures from \"fixtures/jobsFixtures\";\n\ndescribe(\"AdminJobsPage tests\", () => {\n  const queryClient = new QueryClient();\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock.onGet(\"/api/jobs/all\").reply(200, jobsFixtures.sixJobs);\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n  });\n\n  test(\"renders without crashing\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    expect(await screen.findByText(\"Launch Jobs\")).toBeInTheDocument();\n    expect(await screen.findByText(\"Job Status\")).toBeInTheDocument();\n\n    [\"Test Job\", \"Update Courses Database\", \"Update Grade Info\"].map(\n      (jobName) => expect(screen.getByText(jobName)).toBeInTheDocument(),\n    );\n\n    const testId = \"JobsTable\";\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Created`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Updated`),\n    ).toHaveTextContent(\"11/13/2022, 19:49:59\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-status`),\n    ).toHaveTextContent(\"complete\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Log`),\n    ).toHaveTextContent(\"Hello World! from test job!Goodbye from test job!\");\n  });\n\n  test(\"user can submit a test job\", async () => {\n    axiosMock\n      .onPost(\"/api/jobs/launch/testjob?fail=false&sleepMs=0\")\n      .reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Test Job\")).toBeInTheDocument();\n\n    const testJobButton = screen.getByText(\"Test Job\");\n    expect(testJobButton).toBeInTheDocument();\n    testJobButton.click();\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n\n    const sleepMsInput = screen.getByTestId(\"TestJobForm-sleepMs\");\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n\n    expect(sleepMsInput).toBeInTheDocument();\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.change(sleepMsInput, { target: { value: \"0\" } });\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(\n      \"/api/jobs/launch/testjob?fail=false&sleepMs=0\",\n    );\n  });\n\n  test(\"user can submit the update course data job\", async () => {\n    axiosMock\n      .onPost(\n        \"/api/jobs/launch/updateCourses?quarterYYYYQ=20211&subjectArea=ANTH&ifStale=true\",\n      )\n      .reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Update Courses Database\"),\n    ).toBeInTheDocument();\n\n    const updateCoursesButton = screen.getByText(\"Update Courses Database\");\n    expect(updateCoursesButton).toBeInTheDocument();\n    updateCoursesButton.click();\n\n    expect(await screen.findByTestId(\"updateCourses\")).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"updateCourses\");\n\n    const expectedKey = \"UpdateCoursesJobForm.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    const selectQuarter = screen.getByTestId(\"UpdateCoursesJobForm.Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20211\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    expect(selectSubject).toBeInTheDocument();\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n\n    expect(submitButton).toBeInTheDocument();\n\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(\n      \"/api/jobs/launch/updateCourses?quarterYYYYQ=20211&subjectArea=ANTH&ifStale=true\",\n    );\n  });\n\n  test(\"user can submit the update course data by quarter job\", async () => {\n    const url =\n      \"/api/jobs/launch/updateQuarterCourses?quarterYYYYQ=20222&ifStale=true\";\n    axiosMock.onPost(url).reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Update Courses Database by quarter\"),\n    ).toBeInTheDocument();\n\n    const updateCoursesButton = screen.getByText(\n      \"Update Courses Database by quarter\",\n    );\n    expect(updateCoursesButton).toBeInTheDocument();\n    updateCoursesButton.click();\n\n    const submitButton = screen.getByTestId(\"updateCoursesByQuarter\");\n    expect(\n      await screen.findByTestId(\"updateCoursesByQuarter\"),\n    ).toBeInTheDocument();\n\n    const selectQuarter = screen.getByTestId(\n      \"UpdateCoursesByQuarterJobForm.Quarter\",\n    );\n    userEvent.selectOptions(selectQuarter, \"20222\");\n    expect(submitButton).toBeInTheDocument();\n\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(url);\n  });\n\n  test(\"user can submit the update course data by quarter range job\", async () => {\n    const url =\n      \"/api/jobs/launch/updateCoursesRangeOfQuarters?start_quarterYYYYQ=20212&end_quarterYYYYQ=20213&ifStale=true\";\n    axiosMock.onPost(url).reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Update Courses Database by quarter range\"),\n    ).toBeInTheDocument();\n\n    const updateCoursesButton = screen.getByText(\n      \"Update Courses Database by quarter range\",\n    );\n    expect(updateCoursesButton).toBeInTheDocument();\n    updateCoursesButton.click();\n\n    const submitButton = screen.getByTestId(\"updateCoursesByQuarterRange\");\n    expect(\n      await screen.findByTestId(\"updateCoursesByQuarterRange\"),\n    ).toBeInTheDocument();\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20212\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20213\");\n    expect(submitButton).toBeInTheDocument();\n\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(url);\n  });\n\n  test(\"user can submit update grade info\", async () => {\n    const url = \"/api/jobs/launch/uploadGradeData\";\n    axiosMock.onPost(url).reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Update Grades\")).toBeInTheDocument();\n\n    const updateGradeButton = screen.getByText(\"Update Grade Info\");\n    expect(updateGradeButton).toBeInTheDocument();\n    updateGradeButton.click();\n\n    const submitGradeButton = screen.getByTestId(\"updateGradeInfoSubmit\");\n    expect(submitGradeButton).toBeInTheDocument();\n\n    submitGradeButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n    expect(axiosMock.history.post[0].url).toBe(url);\n  });\n});\n"},"src/tests/utils/currentUser.test.js":{"tests":[{"id":"86","name":"utils/currentUser tests useCurrentUser tests useCurrentUser retrieves initial data","location":{"start":{"column":6,"line":21}}},{"id":"87","name":"utils/currentUser tests useCurrentUser tests useCurrentUser retrieves data from API","location":{"start":{"column":6,"line":59}}},{"id":"88","name":"utils/currentUser tests useCurrentUser tests useCurrentUser when API unreachable","location":{"start":{"column":6,"line":85}}},{"id":"89","name":"utils/currentUser tests useCurrentUser tests useCurrentUser handles missing roles correctly","location":{"start":{"column":6,"line":115}}},{"id":"90","name":"utils/currentUser tests useLogout tests useLogout","location":{"start":{"column":6,"line":147}}},{"id":"91","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined","location":{"start":{"column":6,"line":181}}},{"id":"92","name":"utils/currentUser tests hasRole tests some code paths when data is in currentUser","location":{"start":{"column":6,"line":193}}},{"id":"93","name":"utils/currentUser tests hasRole tests hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined","location":{"start":{"column":6,"line":211}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useCurrentUser, useLogout, hasRole } from \"main/utils/currentUser\";\nimport { renderHook, waitFor } from \"@testing-library/react\";\nimport {\n  apiCurrentUserFixtures,\n  currentUserFixtures,\n} from \"fixtures/currentUserFixtures\";\nimport mockConsole from \"jest-mock-console\";\nimport { act } from \"react\";\nimport { useNavigate } from \"react-router-dom\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\njest.mock(\"react-router-dom\");\nconst { MemoryRouter } = jest.requireActual(\"react-router-dom\");\n\ndescribe(\"utils/currentUser tests\", () => {\n  describe(\"useCurrentUser tests\", () => {\n    test(\"useCurrentUser retrieves initial data\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").timeoutOnce();\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const restoreConsole = mockConsole();\n\n      const { result } = renderHook(() => useCurrentUser(), {\n        wrapper,\n      });\n      await waitFor(() => result.current.isSuccess);\n\n      expect(result.current.data).toEqual({\n        loggedIn: false,\n        root: null,\n        initialData: true,\n      });\n\n      const queryState = queryClient.getQueryState(\"current user\");\n      expect(queryState).toBeDefined();\n\n      queryClient.clear();\n\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n    });\n\n    test(\"useCurrentUser retrieves data from API\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock\n        .onGet(\"/api/currentUser\")\n        .reply(200, apiCurrentUserFixtures.userOnly);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const { result } = renderHook(() => useCurrentUser(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n\n      expect(result.current.data).toEqual(currentUserFixtures.userOnly);\n      queryClient.clear();\n    });\n\n    test(\"useCurrentUser when API unreachable\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").reply(404);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n\n      expect(result.current.data).toEqual({\n        initialData: true,\n        loggedIn: false,\n        root: null,\n      });\n      queryClient.clear();\n    });\n\n    test(\"useCurrentUser handles missing roles correctly\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const apiResult = apiCurrentUserFixtures.missingRolesToTestErrorHandling;\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/currentUser\").reply(200, apiResult);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useCurrentUser(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error getting roles: /);\n      restoreConsole();\n\n      let expectedResult = {\n        loggedIn: true,\n        root: { ...apiResult, rolesList: [\"ERROR_GETTING_ROLES\"] },\n      };\n      expect(result.current.data).toEqual(expectedResult);\n      queryClient.clear();\n    });\n  });\n  describe(\"useLogout tests\", () => {\n    test(\"useLogout\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          <"+"MemoryRouter>{children}<"+"/MemoryRouter>\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onPost(\"/logout\").reply(200);\n\n      const navigateSpy = jest.fn();\n      useNavigate.mockImplementation(() => navigateSpy);\n\n      const resetQueriesSpy = jest.spyOn(queryClient, \"resetQueries\");\n\n      const { result } = renderHook(() => useLogout(), { wrapper });\n\n      act(() => {\n        expect(useNavigate).toHaveBeenCalled(); rue, root: { rolesList: [\"ROLE_USER\"] } },\n          \"ROLE_ADMIN\",\n        ),\n      ).toBeFalsy();\n      expect(\n        hasRole(\n          { loggedIn: true, root: { rolesList: [\"ROLE_USER\", \"ROLE_ADMIN\"] } },\n          \"ROLE_ADMIN\",\n        ),\n      ).toBeTruthy();\n    });\n  });\n});\n"},"src/tests/components/BasicCourseSearch/CourseOverTimeInstructorSearchForm.test.js":{"tests":[{"id":"94","name":"CourseOverTimeInstructorSearchForm tests renders without crashing","location":{"start":{"column":4,"line":46}}},{"id":"95","name":"CourseOverTimeInstructorSearchForm tests when I select a start quarter, the state for start quarter changes","location":{"start":{"column":4,"line":56}}},{"id":"96","name":"CourseOverTimeInstructorSearchForm tests when I select an end quarter, the state for end quarter changes","location":{"start":{"column":4,"line":69}}},{"id":"97","name":"CourseOverTimeInstructorSearchForm tests when I select an instructor name, the state for instructor name changes","location":{"start":{"column":4,"line":82}}},{"id":"98","name":"CourseOverTimeInstructorSearchForm tests when I select the checkbox, the state for checkbox changes","location":{"start":{"column":4,"line":95}}},{"id":"99","name":"CourseOverTimeInstructorSearchForm tests when I click submit, the right stuff happens","location":{"start":{"column":4,"line":116}}},{"id":"100","name":"CourseOverTimeInstructorSearchForm tests when I click submit when JSON is EMPTY, setCourse is not called!","location":{"start":{"column":4,"line":162}}},{"id":"101","name":"CourseOverTimeInstructorSearchForm tests renders without crashing when fallback values are used","location":{"start":{"column":4,"line":196}}},{"id":"102","name":"CourseOverTimeInstructorSearchForm tests Button padding is correct","location":{"start":{"column":4,"line":225}}}],"source":"import React from \"react\";\nimport { render, screen, waitFor } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-
