\n    await waitFor(() => expect(fetchJSONSpy).toHaveBeenCalledTimes(1));\n\n    expect(fetchJSONSpy).toHaveBeenCalledWith(\n      expect.any(Object),\n      expectedFields,\n    );\n  });\n\n  test(\"when I click submit when JSON is EMPTY, setCourse is not called!\", async () => {\n    const sampleReturnValue = {\n      sampleKey: \"sampleValue\",\n      total: 0,\n    };\n\n    const fetchJSONSpy = jest.fn();\n\n    fetchJSONSpy.mockResolvedValue(sampleReturnValue);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedKey = \"CourseOverTimeBuildingsSearch.BuildingCode-option-0\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20204\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20204\");\n    const selectBuilding = screen.getByLabelText(\"Building Name\");\n    userEvent.selectOptions(selectBuilding, \"GIRV\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n  });\n\n  test(\"renders without crashing when fallback values are used\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Make sure the first and last options\n    expect(\n      await screen.findByTestId(\n        \"CourseOverTimeBuildingsSearch.StartQuarter-option-0\",\n      ),\n    ).toHaveValue(\"20211\");\n    expect(\n      await screen.findByTestId(\n        \"CourseOverTimeBuildingsSearch.EndQuarter-option-3\",\n      ),\n    ).toHaveValue(\"20214\");\n    expect(\n      await screen.findByTestId(\n        \"CourseOverTimeBuildingsSearch.BuildingCode-option-0\",\n      ),\n    ).toHaveValue(\"\");\n    expect(\n      await screen.findByTestId(\n        \"CourseOverTimeBuildingsSearch.BuildingCode-option-3\",\n      ),\n    ).toHaveValue(\"BRDA\");\n  });\n\n  test(\"Button padding is correct\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const submitButton = screen.getByText(\"Submit\");\n    const buttonCol = submitButton.parentElement;\n    const buttonRow = buttonCol.parentElement;\n    expect(buttonRow).toHaveAttribute(\n      \"style\",\n      \"padding-top: 10px; padding-bottom: 10px;\",\n    );\n  });\n});\n"},"src/tests/pages/PersonalSchedules/PersonalSchedulesIndexPage.test.js":{"tests":[{"id":"111","name":"PersonalSchedulesIndexPage tests renders without crashing for regular user","location":{"start":{"column":4,"line":51}}},{"id":"112","name":"PersonalSchedulesIndexPage tests renders without crashing for admin user","location":{"start":{"column":4,"line":65}}},{"id":"113","name":"PersonalSchedulesIndexPage tests renders three PersonalSchedules without crashing for regular user","location":{"start":{"column":4,"line":79}}},{"id":"114","name":"PersonalSchedulesIndexPage tests renders 'Add New Personal Schedule' button","location":{"start":{"column":4,"line":105}}},{"id":"115","name":"PersonalSchedulesIndexPage tests renders three PersonalSchedules without crashing for admin user","location":{"start":{"column":4,"line":126}}},{"id":"116","name":"PersonalSchedulesIndexPage tests renders empty table when backend unavailable, user only","location":{"start":{"column":4,"line":152}}},{"id":"117","name":"PersonalSchedulesIndexPage tests what happens when you click delete, admin","location":{"start":{"column":4,"line":184}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"jest-mock-console\";\n\nimport PersonalSchedulesIndexPage from \"main/pages/PersonalSchedules/PersonalSchedulesIndexPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { personalScheduleFixtures } from \"fixtures/personalScheduleFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"PersonalSchedulesIndexPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const testId = \"PersonalSchedulesTable\";\n\n  const setupUserOnly = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  const setupAdminUser = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  test(\"renders without crashing for regular user\", () => {\n    setupUserOnly();\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/personalschedules/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for admin user\", () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/personalschedules/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders three PersonalSchedules without crashing for regular user\", async () => {\n    setupUserOnly();\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/personalschedules/all\")\n      .reply(200, personalScheduleFixtures.threePersonalSchedules);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-id`),\n    ).toHaveTextContent(\"1\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(screen.getByTestId(`${testId}-cell-row-2-col-id`)).toHaveTextContent(\n      \"3\",\n    );\n  });\n\n  test(\"renders 'Add New Personal Schedule' button\", () => {\n    setupUserOnly();\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/personalschedules/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const addButton = screen.getByRole(\"button\", {\n      name: /add new personal schedule/i,\n    });\n    expect(addButton).toBeInTheDocument();\n\n    userEvent.click(addButton);\n  });\n\n  test(\"renders three PersonalSchedules without crashing for admin user\", async () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/personalschedules/all\")\n      .reply(200, personalScheduleFixtures.threePersonalSchedules);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-id`),\n    ).toHaveTextContent(\"1\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(screen.getByTestId(`${testId}-cell-row-2-col-id`)).toHaveTextContent(\n      \"3\",\n    );\n  });\n\n  test(\"renders empty table when backend unavailable, user only\", async () => {\n    setupUserOnly();\n\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/personalschedules/all\").timeout();\n\n    const restoreConsole = mockConsole();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    const errorMessage = console.error.mock.calls[0][0];\n    expect(errorMessage).toMatch(\n      \"Error communicating with backend via GET on /api/personalschedules/all\",\n    );\n    restoreConsole();\n\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-id`),\n    ).not.toBeInTheDocument();\n  });\n\n  // to be uncommented when Delete is implemented\n  test(\"what happens when you click delete, admin\", async () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/personalschedules/all\")\n      .reply(200, personalScheduleFixtures.threePersonalSchedules);\n    axiosMock\n      .onDelete(\"/api/personalschedules\")\n      .reply(200, \"PersonalSchedule with id 1 was deleted\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-id`),\n    ).toHaveTextContent(\"1\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\n      \"2\",\n    );\n    expect(screen.getByTestId(`${testId}-cell-row-2-col-id`)).toHaveTextContent(\n      \"3\",\n    );\n\n    const deleteButton = screen.getByTestId(\n      `${testId}-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => {\n      expect(mockToast).toBeCalledWith(\n        \"PersonalSchedule with id 1 was deleted\",\n      );\n    });\n  });\n});\n"},"src/tests/components/BasicCourseSearch/BasicCourseSearchForm.test.js":{"tests":[{"id":"118","name":"BasicCourseSearchForm tests renders without crashing","location":{"start":{"column":4,"line":45}}},{"id":"119","name":"BasicCourseSearchForm tests when I select a quarter, the state for quarter changes","location":{"start":{"column":4,"line":55}}},{"id":"120","name":"BasicCourseSearchForm tests when I select a subject, the state for subject changes","location":{"start":{"column":4,"line":68}}},{"id":"121","name":"BasicCourseSearchForm tests when I select a level, the state for level changes","location":{"start":{"column":4,"line":90}}},{"id":"122","name":"BasicCourseSearchForm tests when I click submit, the right stuff happens","location":{"start":{"column":4,"line":103}}},{"id":"123","name":"BasicCourseSearchForm tests when I click submit when JSON is EMPTY, setCourse is not called!","location":{"start":{"column":4,"line":150}}},{"id":"124","name":"BasicCourseSearchForm tests renders without crashing when fallback values are used","location":{"start":{"column":4,"line":185}}}],"source":"import React from \"react\";\nimport { render, screen, waitFor } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport { toast } from \"react-toastify\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport BasicCourseSearchForm from \"main/components/BasicCourseSearch/BasicCourseSearchForm\";\n\njest.mock(\"react-toastify\", () => ({\n  toast: jest.fn(),\n}));\n\ndescribe(\"BasicCourseSearchForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const queryClient = new QueryClient();\n  const addToast = jest.fn();\n\n  beforeEach(() => {\n    jest.clearAllMocks();\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      ...systemInfoFixtures.showingNeither,\n      startQtrYYYYQ: \"20201\",\n      endQtrYYYYQ: \"20214\",\n    });\n\n    toast.mockReturnValue({\n      addToast: addToast,\n    });\n  });\n\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"BasicCourseSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"when I select a quarter, the state for quarter changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"BasicCourseSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectQuarter = screen.getByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20204\");\n    expect(selectQuarter.value).toBe(\"20204\");\n  });\n\n  test(\"when I select a subject, the state for subject changes\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"BasicCourseSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedKey = \"BasicSearch.Subject-option-MATH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    userEvent.selectOptions(selectSubject, \"MATH\");\n\n    expect(selectSubject.value).toBe(\"MATH\");\n  });\n\n  test(\"when I select a level, the state for level changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"BasicCourseSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectLevel = screen.getByLabelText(\"Course Level\");\n    userEvent.selectOptions(selectLevel, \"G\");\n    expect(selectLevel.value).toBe(\"G\");\n  });\n\n  test(\"when I click submit, the right stuff happens\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    const sampleReturnValue = {\n      sampleKey: \"sampleValue\",\n    };\n\n    const fetchJSONSpy = jest.fn();\n\n    fetchJSONSpy.mockResolvedValue(sampleReturnValue);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"BasicCourseSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedFields = {\n      quarter: \"20211\",\n      subject: \"ANTH\",\n      level: \"G\",\n    };\n\n    const expectedKey = \"BasicSearch.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    const selectQuarter = screen.getByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20211\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    expect(selectSubject).toBeInTheDocument();\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n    const selectLevel = screen.getByLabelText(\"Course Level\");\n    userEvent.selectOptions(selectLevel, \"G\");\n    const submitButton = screen.getByText(\"Submit\");\n    userEvent.click(submitButton);\n\n    await waitFor(() => expect(fetchJSONSpy).toHaveBeenCalledTimes(1));\n\n    expect(fetchJSONSpy).toHaveBeenCalledWith(\n      expect.any(Object),\n      expectedFields,\n    );\n  });\n\n  test(\"when I click submit when JSON is EMPTY, setCourse is not called!\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n\n    const sampleReturnValue = {\n      sampleKey: \"sampleValue\",\n      total: 0,\n    };\n\n    const fetchJSONSpy = jest.fn();\n\n    fetchJSONSpy.mockResolvedValue(sampleReturnValue);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"BasicCourseSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedKey = \"BasicSearch.Subject-option-MATH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    const selectQuarter = screen.getByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20204\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    userEvent.selectOptions(selectSubject, \"MATH\");\n    const selectLevel = screen.getByLabelText(\"Course Level\");\n    userEvent.selectOptions(selectLevel, \"G\");\n    const submitButton = screen.getByText(\"Submit\");\n    userEvent.click(submitButton);\n  });\n\n  test(\"renders without crashing when fallback values are used\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"BasicCourseSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Make sure the first and last options\n    expect(\n      await screen.findByTestId(/BasicSearch.Quarter-option-0/),\n    ).toHaveValue(\"20211\");\n    expect(\n      await screen.findByTestId(/BasicSearch.Quarter-option-3/),\n    ).toHaveValue(\"20214\");\n  });\n});\n"},"src/tests/pages/PersonalSchedules/PersonalSchedulesCreatePage.test.js":{"tests":[{"id":"125","name":"PersonalSchedulesCreatePage tests renders without crashing","location":{"start":{"column":4,"line":48}}},{"id":"126","name":"PersonalSchedulesCreatePage tests when you fill in the form and hit submit, it makes a request to the backend","location":{"start":{"column":4,"line":59}}},{"id":"127","name":"PersonalSchedulesCreatePage tests when the backend returns an error, user gets toast with error message","location":{"start":{"column":4,"line":118}}},{"id":"128","name":"PersonalSchedulesCreatePage tests filling the form with a duplicate personal schedule returns an error","location":{"start":{"column":4,"line":160}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport PersonalSchedulesCreatePage from \"main/pages/PersonalSchedules/PersonalSchedulesCreatePage\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => {\n  const originalModule = jest.requireActual(\"react-router-dom\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    Navigate: (x) => {\n      mockNavigate(x);\n      return null;\n    },\n  };\n});\n\ndescribe(\"PersonalSchedulesCreatePage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  test(\"renders without crashing\", () => {\n    const queryClient = new QueryClient();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesCreatePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"when you fill in the form and hit submit, it makes a request to the backend\", async () => {\n    const queryClient = new QueryClient();\n    const personalSchedule = {\n      id: 17,\n      name: \"SampName\",\n      description: \"desc\",\n      quarter: \"W08\",\n    };\n    axiosMock\n      .onPost(\"/api/personalschedules/post\")\n      .reply(202, personalSchedule);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesCreatePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"PersonalScheduleForm-name\"),\n    ).toBeInTheDocument();\n\n    const nameField = screen.getByTestId(\"PersonalScheduleForm-name\");\n    const descriptionField = screen.getByTestId(\n      \"PersonalScheduleForm-description\",\n    );\n    const quarterField = document.querySelector(\n      \"#PersonalScheduleForm-quarter\",\n    );\n    const submitButton = screen.getByTestId(\"PersonalScheduleForm-submit\");\n\n    fireEvent.change(nameField, { target: { value: \"SampName\" } });\n    fireEvent.change(descriptionField, { target: { value: \"desc\" } });\n    fireEvent.change(quarterField, { target: { value: \"20124\" } });\n\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.click(submitButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(quarterField).toHaveValue(\"20124\");\n\n    expect(axiosMock.history.post[0].params).toEqual({\n      name: \"SampName\",\n      description: \"desc\",\n      quarter: \"20124\",\n    });\n\n    expect(mockToast).toHaveBeenCalledWith(\n      \"New personalSchedule Created - id: 17 name: SampName\",\n    );\n    expect(mockNavigate).toHaveBeenCalledWith({\n      to: \"/personalschedules/list\",\n    });\n  });\n\n  test(\"when the backend returns an error, user gets toast with error message\", async () => {\n    const queryClient = new QueryClient();\n    axiosMock\n      .onPost(\"/api/personalschedules/post\")\n      .reply(500, { message: \"The backend is in a mood today\" });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesCreatePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"PersonalScheduleForm-name\"),\n    ).toBeInTheDocument();\n\n    const nameField = screen.getByTestId(\"PersonalScheduleForm-name\");\n    const descriptionField = screen.getByTestId(\n      \"PersonalScheduleForm-description\",\n    );\n    const quarterField = document.querySelector(\n      \"#PersonalScheduleForm-quarter\",\n    );\n    const submitButton = screen.getByTestId(\"PersonalScheduleForm-submit\");\n\n    fireEvent.change(nameField, { target: { value: \"SampName\" } });\n    fireEvent.change(descriptionField, { target: { value: \"desc\" } });\n    fireEvent.change(quarterField, { target: { value: \"20124\" } });\n\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.click(submitButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(mockToast).toHaveBeenCalledWith(\n      \"Error: The backend is in a mood today\",\n    );\n  });\n\n  test(\"filling the form with a duplicate personal schedule returns an error\", async () => {\n    const queryClient = new QueryClient();\n    const error = {\n      message:\n        \"A personal schedule with that name already exists in that quarter\",\n    };\n\n    axiosMock.onPost(\"/api/personalschedules/post\").reply(404, error);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesCreatePage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(\"PersonalScheduleForm-name\"),\n    ).toBeInTheDocument();\n\n    const nameField = screen.getByTestId(\"PersonalScheduleForm-name\");\n    const descriptionField = screen.getByTestId(\n      \"PersonalScheduleForm-description\",\n    );\n    const quarterField = document.querySelector(\n      \"#PersonalScheduleForm-quarter\",\n    );\n    const submitButton = screen.getByTestId(\"PersonalScheduleForm-submit\");\n\n    fireEvent.change(nameField, { target: { value: \"Duplicate\" } });\n    fireEvent.change(descriptionField, { target: { value: \"dupe\" } });\n    fireEvent.change(quarterField, { target: { value: \"20124\" } });\n\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.click(submitButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n  });\n});\n"},"src/tests/pages/PersonalSchedules/PersonalSchedulesDetailsPage.test.js":{"tests":[{"id":"130","name":"PersonalSchedulesDetailsPage tests renders without crashing for regular user","location":{"start":{"column":4,"line":63}}},{"id":"131","name":"PersonalSchedulesDetailsPage tests shows the correct info for admin users","location":{"start":{"column":4,"line":76}}},{"id":"132","name":"PersonalSchedulesDetailsPage tests renders 'Back' button","location":{"start":{"column":4,"line":159}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport PersonalSchedulesDetailsPage from \"main/pages/PersonalSchedules/PersonalSchedulesDetailsPage\";\nimport { personalScheduleFixtures } from \"fixtures/personalScheduleFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => {\n  const originalModule = jest.requireActual(\"react-router-dom\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    useParams: () => ({\n      id: 17,\n    }),\n    Navigate: (x) => {\n      mockNavigate(x);\n      return null;\n    },\n  };\n});\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"PersonalSchedulesDetailsPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const testId = \"PersonalSchedulesTable\";\n\n  const setupAdminUser = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  beforeEach(() => {\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n  });\n\n  afterEach(() => {\n    console.error.mockRestore();\n  });\n\n  test(\"renders without crashing for regular user\", () => {\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/personalschedules/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesDetailsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"shows the correct info for admin users\", async () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(`/api/personalschedules?id=17`)\n      .reply(200, personalScheduleFixtures.onePersonalScheduleDiffId);\n    axiosMock\n      .onGet(`api/personalSections/all?psId=17`)\n      .reply(200, personalScheduleFixtures.threePersonalSchedulesDiffId);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesDetailsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await waitFor(() => {\n      expect(\n        screen.getByText(\"Personal Schedules Details\"),\n      ).toBeInTheDocument();\n    });\n    await waitFor(() => {\n      expect(\n        screen.getByText(\"Sections in Personal Schedule\"),\n      ).toBeInTheDocument();\n    });\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"PersonalSchedulesTable-cell-row-0-col-id\"),\n      ).toHaveTextContent(\"17\");\n    });\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"PersonalSectionsTable-cell-row-0-col-courseId\"),\n      ).toHaveTextContent(\"ECE 1A\");\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-description`),\n    ).toHaveTextContent(\"My Winter Courses\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-name`),\n    ).toHaveTextContent(\"CS156\");\n    expect(\n      screen.getByTestId(\n        `PersonalSectionsTable-cell-row-0-col-classSections[0].enrollCode`,\n      ),\n    ).toHaveTextContent(\"12583\");\n    expect(\n      screen.getByTestId(\n        `PersonalSectionsTable-cell-row-0-col-classSections[0].section`,\n      ),\n    ).toHaveTextContent(\"0100\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-title`),\n    ).toHaveTextContent(\"COMP ENGR SEMINAR\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-enrolled`),\n    ).toHaveTextContent(\"84/100\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-location`),\n    ).toHaveTextContent(\"BUCHN 1930\");\n    expect(\n      screen.getByTestId(\n        `PersonalSectionsTable-cell-row-0-col-classSections[0].timeLocations[0].days`,\n      ),\n    ).toHaveTextContent(\"M\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-time`),\n    ).toHaveTextContent(\"3:00 PM - 3:50 PM\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-instructor`),\n    ).toHaveTextContent(\"WANG L C\");\n\n    const deleteButton = screen.getByTestId(\n      `PersonalSectionsTable-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n\n  test(\"renders 'Back' button\", () => {\n    const queryClient = new QueryClient();\n    axiosMock.onGet(`/api/personalschedules?id=17`).reply(200, []);\n    axiosMock.onGet(`api/personalSections/all?psId=17`).reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesDetailsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const backButton = screen.getByRole(\"button\", { name: /back/i });\n    expect(backButton).toBeInTheDocument();\n\n    // Optional: Test button functionality\n    userEvent.click(backButton);\n    // Add your assertions here to ensure that clicking the button triggers the expected action.\n  });\n});\n"},"src/tests/components/SectionsTableBase.test.js":{"tests":[{"id":"134","name":"SectionsTableBase tests renders an empty table without crashing","location":{"start":{"column":4,"line":110}}},{"id":"135","name":"SectionsTableBase tests renders an full table without crashing","location":{"start":{"column":4,"line":114}}},{"id":"136","name":"SectionsTableBase tests renders a single lecture section correctly","location":{"start":{"column":4,"line":120}}},{"id":"137","name":"SectionsTableBase tests renders five sections (one with no discussion then lecture with three discussions) correctly","location":{"start":{"column":4,"line":133}}},{"id":"138","name":"SectionsTableBase tests renders rows with alternating background colors correctly","location":{"start":{"column":4,"line":150}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport SectionsTableBase from \"main/components/SectionsTableBase\";\nimport {\n  oneLectureSectionWithNoDiscussion,\n  gigaSections,\n  fiveSections,\n} from \"fixtures/sectionFixtures\";\nimport { yyyyqToQyy } from \"main/utils/quarterUtilities.js\";\nimport {\n  convertToFraction,\n  formatDays,\n  formatInstructors,\n  formatLocation,\n  formatTime,\n  isSection,\n} from \"main/utils/sectionUtils.js\";\n\ndescribe(\"SectionsTableBase tests\", () => {\n  function getFirstVal(values) {\n    return values[0];\n  }\n\n  const columns = [\n    {\n      Header: \"Quarter\",\n      accessor: (row) => yyyyqToQyy(row.courseInfo.quarter),\n      disableGroupBy: true,\n      id: \"quarter\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Course ID\",\n      accessor: \"courseInfo.courseId\",\n\n      Cell: ({ cell: { value } }) => value.substring(0, value.length - 2),\n    },\n    {\n      Header: \"Title\",\n      accessor: \"courseInfo.title\",\n      disableGroupBy: true,\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      // Stryker disable next-line StringLiteral: this column is hidden, very hard to test\n      Header: \"Is Section?\",\n      accessor: (row) => isSection(row.section.section),\n      // Stryker disable next-line StringLiteral: this column is hidden, very hard to test\n      id: \"isSection\",\n    },\n    {\n      Header: \"Enrolled\",\n      accessor: (row) =>\n        convertToFraction(row.section.enrolledTotal, row.section.maxEnroll),\n      disableGroupBy: true,\n      id: \"enrolled\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Location\",\n      accessor: (row) => formatLocation(row.section.timeLocations),\n      disableGroupBy: true,\n      id: \"location\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Days\",\n      accessor: (row) => formatDays(row.section.timeLocations),\n      disableGroupBy: true,\n      id: \"days\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Time\",\n      accessor: (row) => formatTime(row.section.timeLocations),\n      disableGroupBy: true,\n      id: \"time\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Instructor\",\n      accessor: (row) => formatInstructors(row.section.instructors),\n      disableGroupBy: true,\n      id: \"instructor\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Enroll Code\",\n      accessor: \"section.enrollCode\",\n      disableGroupBy: true,\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n  ];\n\n  test(\"renders an empty table without crashing\", () => {\n    render(<"+"SectionsTableBase columns={columns} data={[]} group={false} />);\n  });\n\n  test(\"renders an full table without crashing\", () => {\n    render(\n      <"+"SectionsTableBase columns={columns} data={gigaSections} group={false} />,\n    );\n  });\n\n  test(\"renders a single lecture section correctly\", async () => {\n    render(\n      <"+"SectionsTableBase\n        columns={columns}\n        data={oneLectureSectionWithNoDiscussion}\n        group={false}\n      />,\n    );\n\n    expect(screen.queryByText(\"\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"\")).not.toBeInTheDocument();\n  });\n\n  test(\"renders five sections (one with no discussion then lecture with three discussions) correctly\", async () => {\n    render(\n      <"+"SectionsTableBase columns={columns} data={fiveSections} group={false} />,\n    );\n\n    expect(screen.getByText(\"\")).toBeInTheDocument();\n    expect(screen.queryByText(\"\")).not.toBeInTheDocument();\n    expect(\n      screen.getByTestId(\n        \"testid-cell-row-1-col-courseInfo.courseId-expand-symbols\",\n      ),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"testid-cell-row-0-col-courseInfo.courseId\"),\n    ).toHaveAttribute(\"style\", \"color: rgb(74, 79, 79); font-weight: bold;\");\n  });\n\n  test(\"renders rows with alternating background colors correctly\", async () => {\n    render(\n      <"+"SectionsTableBase columns={columns} data={gigaSections} group={false} />,\n    );\n\n    // Check the background color of the first few rows\n    const rows = [\n      screen\n        .getByTestId(\"testid-cell-row-0-col-courseInfo.courseId\")\n        .closest(\"tr\"),\n      screen\n        .getByTestId(\"testid-cell-row-1-col-courseInfo.courseId\")\n        .closest(\"tr\"),\n      screen\n        .getByTestId(\"testid-cell-row-2-col-courseInfo.courseId\")\n        .closest(\"tr\"),\n      screen\n        .getByTestId(\"testid-cell-row-3-col-courseInfo.courseId\")\n        .closest(\"tr\"),\n    ];\n\n    // Expected background colors\n    const expectedBackgroundColors = [\n      \"rgb(227, 235, 252)\", // #e3ebfc in RGB format\n      \"rgb(255, 255, 255)\", // #ffffff in RGB format\n      \"rgb(227, 235, 252)\", // #e3ebfc in RGB format\n      \"rgb(255, 255, 255)\", // #ffffff in RGB format\n    ];\n\n    // Verify the background colors for each row\n    rows.forEach((row, index) => {\n      const style = window.getComputedStyle(row);\n      expect(style.backgroundColor).toBe(expectedBackgroundColors[index]);\n    });\n  });\n});\n"},"src/tests/pages/CourseOverTime/CourseOverTimeIndexPage.test.js":{"tests":[{"id":"139","name":"CourseOverTimeIndexPage tests renders without crashing","location":{"start":{"column":4,"line":41}}},{"id":"140","name":"CourseOverTimeIndexPage tests calls UCSB Course over time search api correctly with 3 section response","location":{"start":{"column":4,"line":51}}},{"id":"141","name":"CourseOverTimeIndexPage tests passes sorted sections to SectionsOverTimeTable","location":{"start":{"column":4,"line":102}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport CourseOverTimeIndexPage from \"main/pages/CourseOverTime/CourseOverTimeIndexPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport {\n  threeSections,\n  differentQuarterSections,\n} from \"fixtures/sectionFixtures\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"CourseOverTimeIndexPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"calls UCSB Course over time search api correctly with 3 section response\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/courseovertime/search\")\n      .reply(200, threeSections);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n\n    const expectedKey = \"CourseOverTimeSearch.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n    const enterCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(enterCourseNumber, \"130A\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20222\",\n      endQtr: \"20222\",\n      subjectArea: \"ANTH\",\n      courseNumber: \"130A\",\n    });\n\n    expect(screen.getByText(\"ECE 1A\")).toBeInTheDocument();\n  });\n\n  test(\"passes sorted sections to SectionsOverTimeTable\", async () => {\n    // Mock the response of the API call with differentQuarterSections data\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/courseovertime/search\")\n      .reply(200, differentQuarterSections);\n\n    const spy = jest.spyOn(\n      require(\"main/components/Sections/SectionsOverTimeTable\"),\n      \"default\",\n    );\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n\n    const expectedKey = \"CourseOverTimeSearch.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n    const enterCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(enterCourseNumber, \"130A\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20222\",\n      endQtr: \"20222\",\n      subjectArea: \"ANTH\",\n      courseNumber: \"130A\",\n    });\n\n    // Check that SectionsOverTimeTable received the sorted sections data\n    const sortedSections = differentQuarterSections.sort((a, b) =>\n      b.courseInfo.quarter.localeCompare(a.courseInfo.quarter),\n    );\n    expect(spy).toHaveBeenCalledWith(\n      { sections: sortedSections },\n      expect.anything(),\n    );\n\n    spy.mockRestore();\n  });\n});\n"},"src/tests/components/Jobs/UpdateCoursesByQuarterJobForm.test.js":{"tests":[{"id":"142","name":"UpdateCoursesByQuarterJobForm tests renders correctly with start and end values from systemInfo","location":{"start":{"column":4,"line":27}}},{"id":"143","name":"UpdateCoursesByQuarterJobForm tests renders without crashing when fallback values are used","location":{"start":{"column":4,"line":56}}},{"id":"144","name":"UpdateCoursesByQuarterJobForm tests works when local storage has a value","location":{"start":{"column":4,"line":84}}},{"id":"145","name":"UpdateCoursesByQuarterJobForm tests works when local storage doesn't have a value","location":{"start":{"column":4,"line":124}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\nimport UpdateCoursesByQuarterJobForm from \"main/components/Jobs/UpdateCoursesByQuarterJobForm\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\n// const mockedUseSystemInfo = jest.fn();\n\n// jest.mock(\"main/utils/systemInfo\", () => ({\n//   useSystemInfo: () => mockedUseSystemInfo,\n// }));\n\nconst queryClient = new QueryClient();\n\ndescribe(\"UpdateCoursesByQuarterJobForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  it(\"renders correctly with start and end values from systemInfo\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: \"20201\", // use fallback value\n      endQtrYYYYQ: \"20204\", // use fallback value\n    });\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"UpdateCoursesByQuarterJobForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(/Update Courses/)).toBeInTheDocument();\n    // Make sure the first and last options are what we expect\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterJobForm.Quarter-option-0/,\n      ),\n    ).toHaveValue(\"20221\");\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterJobForm.Quarter-option-3/,\n      ),\n    ).toHaveValue(\"20204\");\n  });\n\n  test(\"renders without crashing when fallback values are used\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"UpdateCoursesByQuarterJobForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Make sure the first and last options are what we expect\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterJobForm.Quarter-option-0/,\n      ),\n    ).toHaveValue(\"20201\");\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterJobForm.Quarter-option-3/,\n      ),\n    ).toHaveValue(\"20214\");\n  });\n\n  test(\"works when local storage has a value\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: \"20191\", // use fallback value\n      endQtrYYYYQ: \"20194\", // use fallback value\n    });\n    const getItemSpy = jest.spyOn(Storage.prototype, \"getItem\");\n\n    getItemSpy.mockImplementation((key) => {\n      const values = {\n        \"UpdateCoursesByQuarterJobForm.Quarter\": \"20193\",\n      };\n      return key in values ? values[key] : null;\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"UpdateCoursesByQuarterJobForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Make sure the first and last options are what we expect\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterJobForm.Quarter-option-0/,\n      ),\n    ).toHaveValue(\"20211\");\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterJobForm.Quarter-option-3/,\n      ),\n    ).toHaveValue(\"20194\");\n\n    // Assert: make sure option from local storage is selected\n    expect(screen.getByRole(\"option\", { name: /M19/i }).selected).toBeTruthy();\n  });\n\n  test(\"works when local storage doesn't have a value\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: \"20181\", // use fallback value\n      endQtrYYYYQ: \"20184\", // use fallback value\n    });\n\n    const getItemSpy = jest.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation((key) => {\n      const values = {};\n      return key in values ? values[key] : null;\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"UpdateCoursesByQuarterJobForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Make sure the first and last options are what we expect\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterJobForm.Quarter-option-0/,\n      ),\n    ).toHaveValue(\"20191\");\n\n    expect(getItemSpy).toHaveBeenCalledWith(\n      \"UpdateCoursesByQuarterJobForm.Quarter\",\n    );\n\n    expect(screen.queryByRole(\"option\", { name: /W19/i }).selected).toBeFalsy();\n    expect(screen.queryByRole(\"option\", { name: /S19/i }).selected).toBeFalsy();\n    expect(screen.queryByRole(\"option\", { name: /M19/i }).selected).toBeFalsy();\n    expect(screen.getByRole(\"option\", { name: /F19/i }).selected).toBeTruthy();\n  });\n});\n"},"src/tests/pages/CourseOverTime/CourseOverTimeInstructorIndexPage.test.js":{"tests":[{"id":"146","name":"CourseOverTimeInstructorIndexPage tests renders without crashing","location":{"start":{"column":4,"line":41}}},{"id":"147","name":"CourseOverTimeInstructorIndexPage tests calls UCSB Course over time search api
