response\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/courseovertime/instructorsearch\")\n      .reply(200, threeSections);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeInstructorIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const enterInstructor = screen.getByLabelText(\"Instructor Name\");\n    userEvent.type(enterInstructor, \"CONRAD\");\n    const selectCheckbox = screen.getByTestId(\n      \"CourseOverTimeInstructorSearchForm-checkbox\",\n    );\n    userEvent.click(selectCheckbox);\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20222\",\n      endQtr: \"20222\",\n      instructor: \"CONRAD\",\n      lectureOnly: true,\n    });\n\n    expect(screen.getByText(\"ECE 1A\")).toBeInTheDocument();\n  });\n\n  test(\"passes sorted sections to SectionsOverTimeTable\", async () => {\n    // Mock the response of the API call with differentQuarterSections data\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/courseovertime/instructorsearch\")\n      .reply(200, differentQuarterSections);\n\n    const spy = jest.spyOn(\n      require(\"main/components/Sections/SectionsInstructorTable\"),\n      \"default\",\n    );\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeInstructorIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const enterInstructor = screen.getByLabelText(\"Instructor Name\");\n    userEvent.type(enterInstructor, \"CONRAD\");\n    const selectCheckbox = screen.getByTestId(\n      \"CourseOverTimeInstructorSearchForm-checkbox\",\n    );\n    userEvent.click(selectCheckbox);\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    // Check that SectionsOverTimeTable received the sorted sections data\n    const sortedSections = differentQuarterSections.sort((a, b) =>\n      b.courseInfo.quarter.localeCompare(a.courseInfo.quarter),\n    );\n    expect(spy).toHaveBeenCalledWith(\n      { sections: sortedSections },\n      expect.anything(),\n    );\n\n    spy.mockRestore();\n  });\n});\n"},"src/tests/pages/CourseOverTime/CourseOverTimeBuildingsIndexPage.test.js":{"tests":[{"id":"149","name":"CourseOverTimeBuildingsIndexPage tests renders without crashing","location":{"start":{"column":4,"line":40}}},{"id":"150","name":"CourseOverTimeBuildingsIndexPage tests calls UCSB Course over time search api correctly with correct response","location":{"start":{"column":4,"line":50}}},{"id":"151","name":"CourseOverTimeBuildingsIndexPage tests calls UCSB Course over time search api correctly with correctly sorted data","location":{"start":{"column":4,"line":95}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport CourseOverTimeBuildingsIndexPage from \"main/pages/CourseOverTime/CourseOverTimeBuildingsIndexPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport {\n  coursesInLib,\n  coursesInLibDifferentDate,\n} from \"fixtures/buildingFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"CourseOverTimeBuildingsIndexPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"calls UCSB Course over time search api correctly with correct response\", async () => {\n    axiosMock\n      .onGet(\"/api/public/courseovertime/buildingsearch\")\n      .reply(200, coursesInLib);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const selectBuilding = screen.getByLabelText(\"Building Name\");\n\n    const expectedKey = \"CourseOverTimeBuildingsSearch.BuildingCode-option-0\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectBuilding, \"GIRV\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20222\",\n      endQtr: \"20222\",\n      buildingCode: \"GIRV\",\n    });\n\n    expect(screen.getByText(\"CHEM 184\")).toBeInTheDocument();\n  });\n\n  test(\"calls UCSB Course over time search api correctly with correctly sorted data\", async () => {\n    axiosMock\n      .onGet(\"/api/public/courseovertime/buildingsearch\")\n      .reply(200, coursesInLibDifferentDate);\n\n    const spy = jest.spyOn(\n      require(\"main/components/Sections/SectionsTable\"),\n      \"default\",\n    );\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20201\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const selectBuilding = screen.getByLabelText(\"Building Name\");\n\n    const expectedKey = \"CourseOverTimeBuildingsSearch.BuildingCode-option-0\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectBuilding, \"GIRV\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20201\",\n      endQtr: \"20222\",\n      buildingCode: \"GIRV\",\n    });\n\n    expect(screen.getByText(\"CHEM 184\")).toBeInTheDocument();\n\n    // Check that CoursesOverTimeBuildings received the sorted sections data\n    const sortedSections = coursesInLibDifferentDate.sort((a, b) =>\n      b.courseInfo.quarter.localeCompare(a.courseInfo.quarter),\n    );\n    expect(spy).toHaveBeenCalledWith(\n      { sections: sortedSections },\n      expect.anything(),\n    );\n\n    spy.mockRestore();\n  });\n});\n"},"src/tests/pages/CourseDetails/CourseDetailsIndexPage.test.js":{"tests":[{"id":"152","name":"Course Details Index Page tests renders without crashing","location":{"start":{"column":4,"line":99}}},{"id":"153","name":"Course Details Index Page tests Calls UCSB Section Search api correctly and displays correct information","location":{"start":{"column":4,"line":109}}},{"id":"154","name":"Course Details Index Page tests Calls grade history api correctly and displays correct information","location":{"start":{"column":4,"line":138}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n// import userEvent from \"@testing-library/user-event\";\n\nimport CourseDetailsIndexPage from \"main/pages/CourseDetails/CourseDetailsIndexPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { personalSectionsFixtures } from \"fixtures/personalSectionsFixtures\";\nimport { oneQuarterCourse } from \"fixtures/gradeHistoryFixtures\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => {\n  const originalModule = jest.requireActual(\"react-router-dom\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    useParams: () => ({\n      qtr: \"20221\",\n      enrollCode: \"06619\",\n    }),\n    Navigate: (x) => {\n      mockNavigate(x);\n      return null;\n    },\n  };\n});\n\nclass ResizeObserver {\n  constructor(callback) {\n    this.callback = callback;\n  }\n  observe() {\n    // Mock implementation of the observe method\n  }\n  unobserve() {\n    // Mock implementation of the unobserve method\n  }\n  disconnect() {\n    // Mock implementation of the disconnect method\n  }\n}\n\nwindow.ResizeObserver = ResizeObserver;\n\njest.mock(\"recharts\", () => {\n  const OriginalModule = jest.requireActual(\"recharts\");\n\n  return {\n    ...OriginalModule,\n    ResponsiveContainer: ({ height, children }) => (\n      <"+"OriginalModule.ResponsiveContainer width={800} height={height}>\n        {children}\n      <"+"/OriginalModule.ResponsiveContainer>\n    ),\n  };\n});\n\ndescribe(\"Course Details Index Page tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  beforeEach(() => {\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n  });\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/sections/sectionsearch\", {\n        params: { qtr: \"20221\", enrollCode: \"06619\" },\n      })\n      .reply(200, personalSectionsFixtures.singleSection);\n    axiosMock\n      .onGet(\"/api/gradehistory/search\", {\n        params: { subjectArea: \"CHEM\", courseNumber: \"184\" },\n      })\n      .reply(200, oneQuarterCourse);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDetailsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Calls UCSB Section Search api correctly and displays correct information\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDetailsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      screen.getByText(\"Course Details for CHEM 184 W22\"),\n    ).toBeInTheDocument();\n\n    expect(screen.getByText(\"Enroll Code\")).toBeInTheDocument();\n    expect(screen.getByText(\"06619\")).toBeInTheDocument();\n    expect(screen.getByText(\"Section\")).toBeInTheDocument();\n    expect(screen.getByText(\"0100\")).toBeInTheDocument();\n    expect(screen.getByText(\"Title\")).toBeInTheDocument();\n    expect(screen.getByText(\"CHEM LITERATURE\")).toBeInTheDocument();\n    expect(screen.getByText(\"Enrolled\")).toBeInTheDocument();\n    expect(screen.getByText(\"19/24\")).toBeInTheDocument();\n    expect(screen.getByText(\"Location\")).toBeInTheDocument();\n    expect(screen.getByText(\"LIB 1312\")).toBeInTheDocument();\n    expect(screen.getByText(\"Days\")).toBeInTheDocument();\n    expect(screen.getByText(\"T R\")).toBeInTheDocument();\n    expect(screen.getByText(\"Time\")).toBeInTheDocument();\n    expect(screen.getByText(\"2:00 PM - 3:15 PM\")).toBeInTheDocument();\n  });\n\n  test(\"Calls grade history api correctly and displays correct information\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDetailsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"Fall 2009 - GONZALEZ T F\")).toBeInTheDocument();\n  });\n});\n"},"src/tests/pages/AdminLoadSubjectsPage.test.js":{"tests":[{"id":"155","name":"AdminLoadSubjectsPage tests renders without crashing for admin user","location":{"start":{"column":4,"line":37}}},{"id":"156","name":"AdminLoadSubjectsPage tests renders three earthquakes without crashing for regular user","location":{"start":{"column":4,"line":51}}},{"id":"157","name":"AdminLoadSubjectsPage tests what happens when you click load, admin - originally nothing in table, load 3 subjects","location":{"start":{"column":4,"line":77}}},{"id":"158","name":"AdminLoadSubjectsPage tests what happens when you click load, admin - originally 3 subjects, load nothing","location":{"start":{"column":4,"line":105}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { ucsbSubjectsFixtures } from \"fixtures/ucsbSubjectsFixtures\";\nimport AdminLoadSubjectsPage from \"main/pages/AdminLoadSubjectsPage\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"AdminLoadSubjectsPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  const testId = \"UCSBSubjectsTable\";\n\n  const setupAdminUser = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  test(\"renders without crashing for admin user\", () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminLoadSubjectsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders three earthquakes without crashing for regular user\", async () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/UCSBSubjects/all\")\n      .reply(200, ucsbSubjectsFixtures.threeSubjects);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminLoadSubjectsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-subjectCode`),\n    ).toHaveTextContent(\"GEOG\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-subjectCode`),\n    ).toHaveTextContent(\"GER\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-subjectCode`),\n    ).toHaveTextContent(\"GREEK\");\n  });\n\n  test(\"what happens when you click load, admin - originally nothing in table, load 3 subjects\", async () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, []);\n    axiosMock\n      .onPost(\"/api/UCSBSubjects/load\")\n      .reply(200, ucsbSubjectsFixtures.threeSubjects);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminLoadSubjectsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`AdminLoadSubjects-Load-Button`),\n    ).toBeInTheDocument();\n\n    const loadButton = screen.getByTestId(`AdminLoadSubjects-Load-Button`);\n    expect(loadButton).toBeInTheDocument();\n    fireEvent.click(loadButton);\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n    expect(mockToast).toHaveBeenCalledWith(\"Number of Subjects Loaded : 3\");\n  });\n\n  test(\"what happens when you click load, admin - originally 3 subjects, load nothing\", async () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(\"/api/UCSBSubjects/all\")\n      .reply(200, ucsbSubjectsFixtures.threeSubjects);\n    axiosMock.onPost(\"/api/UCSBSubjects/load\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminLoadSubjectsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`AdminLoadSubjects-Load-Button`),\n    ).toBeInTheDocument();\n\n    const loadButton = screen.getByTestId(`AdminLoadSubjects-Load-Button`);\n    expect(loadButton).toBeInTheDocument();\n    fireEvent.click(loadButton);\n  });\n});\n"},"src/tests/utils/systemInfo.test.js":{"tests":[{"id":"159","name":"utils/systemInfo tests useSystemInfo tests useSystemInfo retrieves initial data","location":{"start":{"column":6,"line":15}}},{"id":"160","name":"utils/systemInfo tests useSystemInfo tests useSystemInfo retrieves data from API","location":{"start":{"column":6,"line":55}}},{"id":"161","name":"utils/systemInfo tests useSystemInfo tests systemInfo when API unreachable","location":{"start":{"column":6,"line":78}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useSystemInfo } from \"main/utils/systemInfo\";\nimport { renderHook, waitFor } from \"@testing-library/react\";\nimport mockConsole from \"jest-mock-console\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\njest.mock(\"react-router-dom\");\nconst { _MemoryRouter } = jest.requireActual(\"react-router-dom\");\n\ndescribe(\"utils/systemInfo tests\", () => {\n  describe(\"useSystemInfo tests\", () => {\n    test(\"useSystemInfo retrieves initial data\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/systemInfo\").timeoutOnce();\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingNeither);\n\n      const restoreConsole = mockConsole();\n\n      const { result } = renderHook(() => useSystemInfo(), {\n        wrapper,\n      });\n      await waitFor(() => result.current.isSuccess);\n\n      expect(result.current.data).toEqual({\n        initialData: true,\n        springH2ConsoleEnabled: false,\n        showSwaggerUILink: false,\n        startQtrYYYYQ: \"20221\",\n        endQtrYYYYQ: \"20222\",\n      });\n\n      const queryState = queryClient.getQueryState(\"systemInfo\");\n      expect(queryState).toBeDefined();\n\n      queryClient.clear();\n\n      await waitFor(() => expect(console.error).toHaveBeenCalled());\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n    });\n\n    test(\"useSystemInfo retrieves data from API\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock\n        .onGet(\"/api/systemInfo\")\n        .reply(200, systemInfoFixtures.showingBoth);\n\n      const { result } = renderHook(() => useSystemInfo(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n\n      expect(result.current.data).toEqual(systemInfoFixtures.showingBoth);\n      queryClient.clear();\n    });\n\n    test(\"systemInfo when API unreachable\", async () => {\n      const queryClient = new QueryClient();\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      const axiosMock = new AxiosMockAdapter(axios);\n      axiosMock.onGet(\"/api/systemInfo\").reply(404);\n\n      const restoreConsole = mockConsole();\n      const { result } = renderHook(() => useSystemInfo(), {\n        wrapper,\n      });\n\n      await waitFor(() => result.current.isFetched);\n      expect(console.error).toHaveBeenCalled();\n      const errorMessage = console.error.mock.calls[0][0];\n      expect(errorMessage).toMatch(/Error invoking axios.get:/);\n      restoreConsole();\n\n      expect(result.current.data).toEqual({\n        initialData: true,\n        springH2ConsoleEnabled: false,\n        showSwaggerUILink: false,\n        startQtrYYYYQ: \"20221\",\n        endQtrYYYYQ: \"20222\",\n      });\n      queryClient.clear();\n    });\n  });\n});\n"},"src/tests/pages/CourseDescriptions/CourseDescriptionIndexPage.test.js":{"tests":[{"id":"162","name":"CourseDescriptionIndexPage tests renders without crashing","location":{"start":{"column":4,"line":43}}},{"id":"163","name":"CourseDescriptionIndexPage tests calls UCSB Curriculum api correctly with 1 course response","location":{"start":{"column":4,"line":53}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport userEvent from \"@testing-library/user-event\";\n\nimport CourseDescriptionIndexPage from \"main/pages/CourseDescriptions/CourseDescriptionIndexPage\";\nimport { coursesFixtures } from \"fixtures/courseFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"CourseDescriptionIndexPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n  });\n\n  beforeEach(() => {\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDescriptionIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"calls UCSB Curriculum api correctly with 1 course response\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/basicsearch\")\n      .reply(200, { classes: coursesFixtures.oneCourse });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDescriptionIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectQuarter = screen.getByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20211\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n\n    const expectedKey = \"BasicSearch.Subject-option-ANTH\";\n\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    expect(await screen.findByLabelText(\"Subject Area\")).toHaveTextContent(\n      \"ANTH\",\n    );\n\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n    const selectLevel = screen.getByLabelText(\"Course Level\");\n    userEvent.selectOptions(selectLevel, \"G\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      qtr: \"20211\",\n      dept: \"ANTH\",\n      level: \"G\",\n    });\n\n    expect(screen.getByText(\"CMPSC\")).toBeInTheDocument();\n  });\n});\n"},"src/tests/utils/useBackendMutationFailure.test.js":{"tests":[{"id":"164","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles error correctly","location":{"start":{"column":6,"line":30}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { renderHook, waitFor } from \"@testing-library/react\";\nimport mockConsole from \"jest-mock-console\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { useBackendMutation } from \"main/utils/useBackend\";\n\njest.mock(\"react-router-dom\");\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (...params) => mockToast(...params),\n  };\n});\n\ndescribe(\"utils/useBackend tests\", () => {\n  describe(\"utils/useBackend useBackendMutation tests\", () => {\n    var axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n      axiosMock.reset();\n      axiosMock.resetHistory();\n    });\n\n    test(\"useBackendMutation handles error correctly\", async () => {\n      const restoreConsole = mockConsole();\n\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onPost(\"/api/ucsbdates/post\").reply(404);\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () => useBackendMutation(objectToAxiosParams, { onSuccess }),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n\n      mutation.mutate(\n        {\n          quarterYYYYQ: \"20221\",\n          name: \"Groundhog Day\",\n          localDateTime: \"2022-02-02T12:00\",\n        },\n        {\n          onError: (e) =>\n            console.error(\n              \"onError from mutation.mutate called!\",\n              String(e).substring(0, 199),\n            ),\n        },\n      );\n\n      const messageA =\n        \"useBackendMutation: Error communicating with backend via post on /api/ucsbdates/post\";\n      const messageB = \"onError from mutation.mutate called!\";\n      const messageC = \"Error: Request failed with status code 404\";\n\n      await waitFor(() => expect(mockToast).toHaveBeenCalled());\n      expect(mockToast).toHaveBeenCalledTimes(1);\n      expect(mockToast).toHaveBeenCalledWith(messageA, { type: \"error\" });\n\n      expect(console.error).toHaveBeenCalledTimes(2);\n\n      expect(console.error.mock.calls[1][0]).toEqual(messageB);\n      expect(console.error.mock.calls[1][1]).toEqual(messageC);\n\n      restoreConsole();\n    });\n  });\n});\n"},"src/tests/components/PersonalSchedules/AddToScheduleModal.test.js":{"tests":[{"id":"165","name":"AddToScheduleModal renders without crashing","location":{"start":{"column":4,"line":18}}},{"id":"166","name":"AddToScheduleModal opens and closes the modal","location":{"start":{"column":4,"line":26}}},{"id":"167","name":"AddToScheduleModal calls onAdd when save is clicked","location":{"start":{"column":4,"line":46}}},{"id":"168","name":"AddToScheduleModal displays correct message when no schedules found","location":{"start":{"column":4,"line":71}}},{"id":"169","name":"AddToScheduleModal calls onAdd with the correct schedule when save is clicked","location":{"start":{"column":4,"line":91}}}],"source":"import React from \"react\";\nimport { render, fireEvent, waitFor, screen } from \"@testing-library/react\";\nimport \"@testing-library/jest-dom/extend-expect\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport AddToScheduleModal from \"main/components/PersonalSchedules/AddToScheduleModal\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\n\nconst queryClient = new QueryClient();\n\ndescribe(\"AddToScheduleModal\", () => {\n  const quarter = \"20242\";\n  let mockOnAdd;\n\n  beforeEach(() => {\n    mockOnAdd = jest.fn();\n  });\n\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"AddToScheduleModal quarter={quarter} onAdd={mockOnAdd} />\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"opens and closes the modal\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"AddToScheduleModal quarter={quarter} onAdd={mockOnAdd} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.click(screen.getByText(\"Add\"));\n\n    expect(screen.getByText(\"Add to Schedule\")).toBeInTheDocument();\n\n    fireEvent.click(screen.getByText(\"Close\"));\n\n    await waitFor(() => {\n      expect(screen.queryByText(\"Add to Schedule\")).not.toBeInTheDocument();\n    });\n  });\n\n  test(\"calls onAdd when save is clicked\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"AddToScheduleModal quarter={quarter} onAdd={mockOnAdd} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.click(screen.getByText(\"Add\"));\n    fireEvent.click(screen.getByText(\"Save Changes\"));\n\n    expect(mockOnAdd).toHaveBeenCalled();\n  });\n\n  jest.mock(\n    \"main/components/PersonalSchedules/PersonalScheduleSelector\",\n    () => {\n      return ({ setHasSchedules }) => {\n        setHasSchedules(false);\n        return null;\n      };\n    },\n  );\n\n  test(\"displays correct message when no schedules found\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"AddToScheduleModal quarter={quarter} onAdd={mockOnAdd} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.click(screen.getByText(\"Add\"));\n\n    expect(\n      screen.getByText(\"There are no personal schedules for S24.\"),\n    ).toBeInTheDocument();\n    expect(screen.getByText(\"[Create Personal Schedule]\")).toHaveAttribute(\n      \"href\",\n      \"/personalschedules/create\",\n    );\n  });\n\n  test(\"calls onAdd with the correct schedule when save is clicked\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"AddToScheduleModal\n            quarter={quarter}\n            onAdd={mockOnAdd}\n            section={\"Stryker was here!\"}\n          />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    fireEvent.click(screen.getByText(\"Add\"));\n    fireEvent.click(screen.getByText(\"Save Changes\"));\n\n    expect(mockOnAdd).toHaveBeenCalledWith(\"Stryker was here!\", \"\");\n  });\n});\n"},"src/tests/pages/SectionSearches/SectionSearchesIndexPage.test.js":{"tests":[{"id":"170","name":"Section Searches Index Page tests renders without crashing","location":{"start":{"column":4,"line":37}}},{"id":"171","name":"Section Searches Index Page tests calls UCSB section search api correctly with 1 section response","location":{"start":{"column":4,"line":47}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport userEvent from \"@testing-library/user-event\";\n\nimport SectionSearchesIndexPage from \"main/pages/SectionSearches/SectionSearchesIndexPage\";\nimport { oneSection } from \"fixtures/sectionFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"Section Searches Index Page tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  beforeEach(() => {\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionSearchesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"calls UCSB section search api correctly with 1 section response\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock.onGet(\"/api/sections/basicsearch\").reply(200, oneSection);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionSearchesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectQuarter = screen.getByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20222\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n\n    const expectedKey = \"BasicSearch.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n    const selectLevel = screen.getByLabelText(\"Course Level\");\n    userEvent.selectOptions(selectLevel, \"G\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      qtr: \"20222\",\n      dept: \"ANTH\",\n      level: \"G\",\n    });\n\n    expect(screen.getByText(\"ECE 1A\")).toBeInTheDocument();\n  });\n});\n"},"src/tests/pages/AdminUsersPage.test.js":{"tests":[{"id":"172","name":"AdminUsersPage tests renders without crashing on three users","location":{"start":{"column":4,"line":29}}},{"id":"173","name":"AdminUsersPage tests renders empty table when backend unavailable","location":{"start":{"column":4,"line":63}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"jest-mock-console\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport usersFixtures from \"fixtures/usersFixtures\";\nimport AdminUsersPage from \"main/pages/AdminUsersPage\";\n\ndescribe(\"AdminUsersPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const testId = \"UsersTable\";\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  test(\"renders without crashing on three users\", async () => {\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/admin/users\").reply(200, usersFixtures.threeUsers);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminUsersPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Users\")).toBeInTheDocument();\n    expect(\n      await screen.findByTestId(\"UsersTable-cell-row-0-col-id\"),\n    ).toBeInTheDocument();\n\n    expect(\n      screen.getByTestId(`UsersTable-cell-row-0-col-id`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`UsersTable-cell-row-0-col-givenName`),\n    ).toHaveTextContent(\"Phill\");\n    expect(\n      screen.getByTestId(`UsersTable-cell-row-0-col-familyName`),\n    ).toHaveTextContent(\"Conrad\");\n    expect(\n      screen.getByTestId(`UsersTable-cell-row-0-col-email`),\n    ).toHaveTextContent(\"phtcon@ucsb.edu\");\n    expect(\n      screen.getByTestId(`UsersTable-cell-row-0-col-admin`),\n    ).toHaveTextContent(\"true\");\n  });\n\n  test(\"renders empty table when backend unavailable\", async () => {\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/admin/users\").timeout();\n\n    const restoreConsole = mockConsole();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminUsersPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    const errorMessage = console.error.mock.calls[0][0];\n    expect(errorMessage).toMatch(\n      \"Error communicating with backend via GET on /api/admin/users\",\n    );\n    restoreConsole();\n\n    expect(\n      screen.queryByTestId(`${testId}-cell-row-0-col-id`),\n    ).not.toBeInTheDocument();\n  });\n});\n"},"src/tests/utils/useBackendMutationSuccess.test.js":{"tests":[{"id":"174","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles success correctly","location":{"start":{"column":6,"line":30}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { renderHook, act, waitFor } from \"@testing-library/react\";\nimport mockConsole from \"jest-mock-console\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { useBackendMutation } from \"main/utils/useBackend\";\n\njest.mock(\"react-router-dom\");\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"utils/useBackend tests\", () => {\n  describe(\"utils/useBackend useBackendMutation tests\", () => {\n    var axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n      axiosMock.reset();\n      axiosMock.resetHistory();\n    });\n\n    test(\"useBackendMutation handles success correctly\", async () => {\n      const restoreConsole = mockConsole();\n\n      // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n      const queryClient = new QueryClient({\n        defaultOptions: {\n          queries: {\n            //  turns retries off\n            retry: false,\n          },\n        },\n      });\n      const wrapper = ({ children }) => (\n        <"+"QueryClientProvider client={queryClient}>\n          {children}\n        <"+"/QueryClientProvider>\n      );\n\n      axiosMock.onPost(\"/api/ucsbdates/post\").reply(202, {\n        id: 17,\n        quarterYYYYQ: \"20221\",\n        name: \"Groundhog Day\",\n        localDateTime: \"2022-02-02T12:00\",\n      });\n\n      const objectToAxiosParams = (ucsbDate) => ({\n        url: \"/api/ucsbdates/post\",\n        method: \"POST\",\n        params: {\n          quarterYYYYQ: ucsbDate.quarterYYYYQ,\n          name: ucsbDate.name,\n          localDateTime: ucsbDate.localDateTime,\n        },\n      });\n\n      const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n        mockToast(\n          `New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`,\n        );\n      });\n\n      const { result } = renderHook(\n        () =>\n          useBackendMutation(objectToAxiosParams, { onSuccess }, [\n            \"/api/ucsbdates/all\",\n          ]),\n        { wrapper },\n      );\n\n      const mutation = result.current;\n      act(() =>\n        mutation.mutate({\n          quarterYYYYQ: \"20221\",\n          name: \"Groundhog Day\",\n          localDateTime: \"2022-02-02T12:00\",\n        }),\n      );\n\n      await waitFor(() => expect(onSuccess).toHaveBeenCalled());\n      expect(mockToast).toHaveBeenCalledWith(\n        \"New ucsbDate Created - id: 17 name: Groundhog Day\",\n      );\n      restoreConsole();\n    });\n  });\n});\n"},"src/tests/components/Jobs/UpdateCoursesByQuarterRangeJobForm.test.js":{"tests":[{"id":"175","name":"UpdateCoursesByQuarterRangeJobForm tests renders correctly","location":{"start":{"column":4,"line":21}}},{"id":"176","name":"UpdateCoursesByQuarterRangeJobForm tests renders without crashing when fallback values are used","location":{"start":{"column":4,"line":43}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\nimport UpdateCoursesByQuarterRangeJobForm from \"main/components/Jobs/UpdateCoursesByQuarterRangeJobForm\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\nconst queryClient = new QueryClient();\n\ndescribe(\"UpdateCoursesByQuarterRangeJobForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  it(\"renders correctly\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"UpdateCoursesByQuarterRangeJobForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(/Update Courses/)).toBeInTheDocument();\n    expect(\n      screen.getByTestId(/UpdateCoursesByQuarterRangeJobForm.IfStale/),\n    ).toBeInTheDocument();\n  });\n\n  test(\"renders without crashing when fallback values are used\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"UpdateCoursesByQuarterRangeJobForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Make sure the first and last options\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterRangeJobForm.StartQuarter-option-0/,\n      ),\n    ).toHaveValue(\"20211\");\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterRangeJobForm.StartQuarter-option-3/,\n      ),\n    ).toHaveValue(\"20214\");\n\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterRangeJobForm.EndQuarter-option-0/,\n      ),\n    ).toHaveValue(\"20211\");\n    expect(\n      await screen.findByTestId(\n        /UpdateCoursesByQuarterRangeJobForm.EndQuarter-option-3/,\n      ),\n    ).toHaveValue(\"20214\");\n  });\n});\n"},"src/tests/utils/useBackend.test.js":{"tests":[{"id":"177","name":"utils/useBackend tests useBackend handles 404 error correctly","location":{"start":{"column":4,"line":29}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { renderHook, waitFor } from \"@testing-library/react\";\nimport mockConsole from \"jest-mock-console\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { useBackend } from \"main/utils/useBackend\";\n\njest.mock(\"react-router-dom\");\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (...params) => mockToast(...params),\n  };\n});\n\ndescribe(\"utils/useBackend tests\", () => {\n  var axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n  });\n\n  test(\"useBackend handles 404 error correctly\", async () => {\n    const restoreConsole = mockConsole();\n\n    // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n    const queryClient = new QueryClient({\n      defaultOptions: {\n        queries: {\n          //  turns retries off\n          retry: false,\n        },\n      },\n    });\n    const wrapper = ({ children }) => (\n      <"+"QueryClientProvider client={queryClient}>{children}<"+"/QueryClientProvider>\n    );\n\n    axiosMock.onGet(\"/api/admin/users\").reply(404, {});\n\n    const { result } = renderHook(\n      () =>\n        useBackend(\n          [\"/api/admin/users\"],\n          { method: \"GET\", url: \"/api/admin/users\" },\n          [\"initialData\"],\n        ),\n      { wrapper },\n    );\n\n    await waitFor(() => expect(result.current.data).toEqual([\"initialData\"]));\n    await waitFor(() => expect(console.error).toHaveBeenCalled());\n    const errorMessage = console.error.mock.calls[0][0];\n    expect(errorMessage).toMatch(\n      \"Error communicating with backend via GET on /api/admin/users\",\n    );\n    restoreConsole();\n\n    const messageA =\n      \"useBackend: Error communicating with backend via GET on /api/admin/users: Error: Request failed with status code 404\";\n    const messageB =\n      \"Error communicating with backend via GET on /api/admin/users: Error: Request failed with status code 404\";\n\n    await waitFor(() => expect(mockToast).toHaveBeenCalled());\n    expect(mockToast).toHaveBeenCalledTimes(2);\n    expect(mockToast).toHaveBeenCalledWith(messageA, { type: \"error\" });\n    expect(mockToast).toHaveBeenCalledWith(messageB, { type: \"error\" });\n  });\n});\n"},"src/tests/components/Jobs/UpdateCoursesJobForm.test.js":{"tests":[{"id":"178","name":"UpdateCoursesJobForm tests renders correctly","location":{"start":{"column":4,"line":32}}},{"id":"179","name":"UpdateCoursesJobForm tests renders without crashing when fallback values are used","location":{"start":{"column":4,"line":51}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\nimport UpdateCoursesJobForm from \"main/components/Jobs/UpdateCoursesJobForm\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\nconst queryClient = new QueryClient();\n\ndescribe(\"UpdateCoursesJobForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    jest.spyOn(console, \"error\");\n    // @ts-ignore jest.spyOn adds this functionallity\n    console.error.mockImplementation(() => null);\n  });\n\n  afterEach(() => {\n    // @ts-ignore jest.spyOn adds this functionallity\n    console.error.mockRestore();\n  });\n\n  it(\"renders correctly\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"UpdateCoursesJobForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(/Update Courses/)).toBeInTheDocument();\n  });\n\n  it(\"renders without crashing when fallback values are used\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"UpdateCoursesJobForm />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Make sure the first and last options\n    expect(\n      await screen.findByTestId(/UpdateCoursesJobForm.Quarter-option-0/),\n    ).toHaveValue(\"20211\");\n    expect(\n      await screen.findByTestId(/UpdateCoursesJobForm.Quarter-option-3/),\n    ).toHaveValue(\"20214\");\n  });\n});\n"},"src/tests/pages/ProfilePage.test.js":{"tests":[{"id":"180","name":"ProfilePage tests renders correctly for regular logged in user","location":{"start":{"column":4,"line":14}}},{"id":"181","name":"ProfilePage tests renders correctly for admin user","location":{"start":{"column":4,"line":35}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport ProfilePage from \"main/pages/ProfilePage\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"ProfilePage tests\", () => {\n  const queryClient =
